// src/pages/DownloadsPage.tsx
import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { useUser } from '../context/UserContext';

// This type now correctly reflects the data we expect from our custom API
type OrderItem = {
  id: number;
  name: string;
  orderId: number;
  download_url: string; // The direct download link from WooCommerce
  supabase_file_id: string; // The ID for our simulation page
};

// --- Styled Components ---
const PageHeader = styled.h2` font-size: 24px; font-weight: 600; margin-bottom: 24px; `;
const DownloadsTable = styled.div` background-color: white; border-radius: 16px; border: 1px solid #EAEAEA; overflow: hidden; `;
const Row = styled.div` display: grid; grid-template-columns: 3fr 1fr 1fr 2fr; align-items: center; padding: 16px 24px; border-bottom: 1px solid #f0f0f0; &:last-child { border-bottom: none; } `;
const HeaderRow = styled(Row)` background-color: #fafafa; font-weight: 600; color: #333; `;
const DataCell = styled.div` color: #555; `;
const ButtonContainer = styled.div` display: flex; gap: 12px; justify-content: flex-end; `;
const PrimaryButton = styled.a` display: inline-block; background-color: #2c2c54; color: white; padding: 10px 20px; border-radius: 8px; text-decoration: none; font-weight: 500; font-size: 14px; `;
const SecondaryButton = styled(Link)` display: inline-block; background-color: white; color: #2c2c54; border: 1px solid #2c2c54; padding: 10px 20px; border-radius: 8px; text-decoration: none; font-weight: 500; font-size: 14px;`;
const MessageContainer = styled.div` padding: 40px; text-align: center; color: #757575; background-color: white; border-radius: 12px; border: 1px solid #EAEAEA; `;

const DownloadsPage = () => {
  const { user, isLoading: isUserLoading } = useUser();
  const [items, setItems] = useState<OrderItem[]>([]);
  const [isPageLoading, setPageLoading] = useState(true);

  useEffect(() => {
    const getPurchasedItems = async () => {
      if (!user || !user.id) {
        setPageLoading(false);
        return;
      }

      try {
        const { data: apiResponse, error } = await supabase.functions.invoke('get-wc-data', {
          body: { 
            endpoint: 'orders',
            user_id: user.id
          },
        });

        if (error) throw error;

        if (apiResponse.Success && Array.isArray(apiResponse.Data)) {
            const allItems = apiResponse.Data.flatMap((order: any) => 
                // We only want to show items that have a download link or a simulation ID
                (order.line_items || []).filter((item: any) => item.download_url || item.supabase_file_id)
            );
            setItems(allItems);
        }

      } catch (error) {
        console.error('Error fetching purchased items:', error);
      } finally {
        setPageLoading(false);
      }
    };

    if (!isUserLoading) {
      getPurchasedItems();
    }
  }, [isUserLoading, user]);

  if (isUserLoading || isPageLoading) return <MessageContainer>Loading your downloads...</MessageContainer>;
  if (!user) return <MessageContainer>Please log in to view your downloads.</MessageContainer>;

  return (
    <div>
      <PageHeader>Downloads</PageHeader>
      <DownloadsTable>
        <HeaderRow>
          <DataCell>Product</DataCell>
          <DataCell>Downloads Remaining</DataCell>
          <DataCell>Expires</DataCell>
          <DataCell style={{ textAlign: 'right' }}>Actions</DataCell>
        </HeaderRow>
        {items.length > 0 ? items.map((item) => (
          <Row key={item.id}>
            <DataCell>{item.name}</DataCell>
            <DataCell>âˆž</DataCell> {/* Placeholder data */}
            <DataCell>Never</DataCell>   {/* Placeholder data */}
            <DataCell>
              <ButtonContainer>
                {/* The "Download" button now uses the correct download_url from the API */}
                {item.download_url && <PrimaryButton href={item.download_url} target="_blank">Download</PrimaryButton>}

                {/* The "Practice" button now correctly uses the supabase_file_id */}
                {item.supabase_file_id && (
                    <SecondaryButton to={`/practice/${item.supabase_file_id}`}>
                      Practice
                    </SecondaryButton>
                )}
              </ButtonContainer>
            </DataCell>
          </Row>
        )) : (
            <MessageContainer style={{border: 'none', borderRadius: 0}}>You have no available downloads.</MessageContainer>
        )}
      </DownloadsTable>
    </div>
  );
};

export default DownloadsPage;
